import React from 'react';
import { Box, Grommet } from 'grommet';
import image from './A.png'
// import transition from './static/transitions/AtoB.gif'

import AppBar from './components/AppBar'

const theme = {

  global: {
    colors: {
      brand: '#228BE6',
      },
    font: {
      family: 'Roboto',
      size: '18px',
      height: '20px',
    },
  },
};

function App() {
  console.log(image)

  return (
    <Grommet theme={theme} full>
      <header className="App-header">
        { /* <img src={transition} alt="Test image" className="img-responsive" /> */ }
        <AppBar/>
      </header>
    </Grommet>
  );
}

export default App;
